import React, { FC } from "react";

import "./style.css";
import ComponentProps from "./types";

const ShownItems: FC<ComponentProps> = () => {
  return (
    <div className="categories">
      <span>All</span>
      <span>Active</span>
      <span>Completed</span>
    </div>
  );
};

export default ShownItems;
